import React from 'react'
import './Header.css'

function Header() {
    return (
        <nav className="header">
            <img className="header_logo" src="https://images-eu.ssl-images-amazon.com/images/G/39/gc/designs/livepreview/amazon_dkblue_noto_email_v2016_ae-main._CB441728605_.png"></img>
        </nav>
    )
}

export default Header
